import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Card, Button } from 'react-bootstrap';

export default function SGODashboard() {
  const navigate = useNavigate();

  const addCSOPage = () => {
    navigate('/addCSO');
  }

  function cards() {
    return (
      <>
  <div className="d-flex justify-content-between">
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180" />
      <Card.Body>
        <Card.Title>Students</Card.Title>
      </Card.Body>
    </Card>

    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180" />
      <Card.Body>
        <Card.Title>Executives</Card.Title>
      </Card.Body>
    </Card>

    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180" />
      <Card.Body>
        <Card.Title>CSOs</Card.Title>
      </Card.Body>
    </Card>
  </div>
</>
    );
  }

  return (
    <main>
      <h1>SGO Dashboard</h1>
      <p>Welcome, SGO member! Here you can manage clubs, approve events, and view student activities.</p>
      <button onClick={addCSOPage}>Add CSO</button>

      {/* Example usage of cards() to remove warning */}
      {cards()}
    </main>
  );
}
